script: |
  super -f text -I q425.spq | sort > q425.out

inputs:
  - name: q425.spq
    data: |
      SELECT DISTINCT col1 * col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - col2 * - col1 * col2 * - col0 / col1 + col1 * - 29 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q425.out
    data: |
      1344
      295
      3196
